function Card(props) {
    let className;
    {(props.boolean=='true')
    ? className = 'regular'
    : className = ''
    }
       return (
    <div>

      <section >
    
       <div class="cell" className={className}>
           <div class ="cell">{props.english}</div><div class ="cell"> {props.transcription}</div> <div class ="cell"> {props.russian}</div><div class ="cell">{props.tags}</div>
       </div>
  
       </section>
        </div>
    );
}
export default Card
